import React from 'react';
import { CardContent, CardItem, Text, Label } from '../../atoms';

const BasicProfile = (props) => {
    const { name, owned, types } = props;
    return (
        <CardContent>
            <Text headerMain>{name}</Text>
            {owned || owned === 0 ? <Text header italic>Owned : {owned}</Text> : null}
            <Text withSpacing>Type : </Text>
            <CardItem row>
                {types.map((item, idx) => (<Label key={idx}>{item.type.name}</Label>))}
            </CardItem>
        </CardContent>
    )
}

export default BasicProfile;
